                <label>Date de Naisssance</label><br />
                <input onChange={(e) => setAuthor(e.target.value)} type="date" placeholder='date de naissance' /><br />
                <label className='sexe'>Sexe</label><br />
                <label>H</label>
                <input onChange={(e) => setAuthor(e.target.value)} type="radio" name='radio' className='radio' />

                <label>F</label>
                <input onChange={(e) => setAuthor(e.target.value)} type="radio" name='radio' className='radio' /><br />
                <label>Pays</label><br />
                <select onChange={(e) => setAuthor(e.target.value)}>
                    <option>Cameroun</option>
                    <option>Cote d'ivoir</option>
