                    <option>Cameroun</option>

                </select><br />
                <input type="submit" value="SOUMETTRE" className='soumettre' /><br />

                <div className="edition">
                    <em>@ 2022</em>
                    <p>powered by Wbbj</p>
                </div>
            </form>
        </div>
    );
};

export default Inscription;
